CREATE DEFINER=`root`@`localhost` PROCEDURE `GenererFormationsSupplementaires` ()   BEGIN
    DECLARE i INT DEFAULT 46; -- À partir de l'ID 46
    DECLARE dept_count INT DEFAULT 7;
    DECLARE dept_id INT;
    
    WHILE i <= 240 DO -- 46 + 195 = 241 formations au total
        -- Sélectionner un département aléatoire
        SET dept_id = 31 + FLOOR(RAND() * dept_count);
        
        VALUES (
            i,
            CONCAT('Formation ', i-40, ' - Département ', dept_id),
            dept_id,
            6 + FLOOR(RAND() * 4) -- Entre 6 et 9 modules
        );
        
        SET i = i + 1;
    END WHILE;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GenererInscriptionsEtudiants` ()   BEGIN
    DECLARE etudiant_id INT DEFAULT 97;
    DECLARE formation_etudiant INT;
    DECLARE module_id INT;
    DECLARE annee_inscription YEAR;
    DECLARE promo_etudiant INT;
    DECLARE nb_modules_inscrits INT;
    DECLARE j INT;
    
    WHILE etudiant_id <= 13000 DO
        -- Récupérer la formation et la promotion de l'étudiant
        SELECT formation_id, promo INTO formation_etudiant, promo_etudiant
        FROM etudiants 
        WHERE id = etudiant_id;
        
        -- Récupérer les modules de la formation
        -- Inscrire l'étudiant à 4-8 modules aléatoires de sa formation
        SET nb_modules_inscrits = 4 + FLOOR(RAND() * 5);
        SET j = 1;
        
        WHILE j <= nb_modules_inscrits DO
            -- Sélectionner un module aléatoire de la formation
            SELECT m.id INTO module_id
            FROM modules m
            WHERE m.formation_id = formation_etudiant
            ORDER BY RAND()
            LIMIT 1;
            
            -- Déterminer l'année d'inscription (même année que la promotion ou année suivante)
            SET annee_inscription = promo_etudiant + FLOOR(RAND() * 2);
            
            -- Éviter les doublons
            VALUES (etudiant_id, module_id, annee_inscription);
            
            SET j = j + 1;
        END WHILE;
        
        SET etudiant_id = etudiant_id + 1;
    END WHILE;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `GenererModulesFormations` ()   BEGIN
    DECLARE i INT DEFAULT 107; -- À partir de l'ID 107
    DECLARE formation_id INT DEFAULT 41;
    DECLARE nb_modules_formation INT;
    DECLARE j INT;
    DECLARE nom_module VARCHAR(100);
    
    WHILE formation_id <= 240 DO
        -- Déterminer le nombre de modules pour cette formation (entre 6 et 9)
        SET nb_modules_formation = 6 + FLOOR(RAND() * 4);
        SET j = 1;
        
        WHILE j <= nb_modules_formation DO
            SET nom_module = CONCAT('Module ', j, ' - Formation ', formation_id);
            
            VALUES (
                i,
                nom_module,
                formation_id,
                3 + FLOOR(RAND() * 4) -- Crédits entre 3 et 6
            );
            
            SET i = i + 1;
            SET j = j + 1;
        END WHILE;
        
        -- Mettre à jour le nombre de modules dans la table formations
        UPDATE formations 
        SET nb_modules = nb_modules_formation 
        WHERE id = formation_id;
        
        SET formation_id = formation_id + 1;
    END WHILE;
END$$

